import React from "react";

const Dropdown = (props) => {

  const numbers60 = Array.from(Array(10).keys);

  return (
    <select>
        {
            numbers60.map(n => {
                return (<option>{n.value}</option>);
            })
        }
    </select>
  )
};

export default Panel;
